import axios from "axios";
import { useState, useEffect } from "react";
import Post from "../components/Post/Post";

const HomePage = () => {

  const [postData, setPostData] = useState([]);

  useEffect(() => {
    const getData = async () => {
      const data = await axios.get('/api/posts')
      setPostData(data)
    }

    getData()

  }, [])

  return (
    <>
      <Post img="https://www.nme.com/wp-content/uploads/2022/10/Rick_And_Morty_Portal_Gun_JuRicksic_Mort.jpg" />
      <Post img="https://m.media-amazon.com/images/M/MV5BYjAxMTI1ZWEtMDEyOC00YWY3LWJiNTMtZWY1YWQxNTYxMzNjXkEyXkFqcGdeQXVyMTE3OTA2MTY1._V1_.jpg" />
    </>
  );
};

export default HomePage;
